import Styled from 'styled-components'

export default Styled.div`
    .icon {
        height: 38.4rem;
        width: 38.4rem;
        fill: #ccc;
    }
    h1 {
        font-family: misery;
        font-size: 10rem;
        text-align: center;
        color: red;
        letter-spacing: 1vw;
    }
`
